import React, { useState, useEffect } from "react";
import CommonSection from "../components/UI/common-section/CommonSection";
import './About.css'
import Jewelry from "../components/About/jewelry"
import Helmet from "../components/Helmet/Helmet";

const Contact = () => {
  const [produits, setProduits] = useState([]);

  useEffect(() => {
    fetch('http://localhost:8060/product/')
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then(data => {
        console.log(data);
        setProduits(data);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <Helmet title="Panier">
      <CommonSection title="Nos Informations" />
      <div className="app">
        <main className="app-main">
          <Jewelry />
        </main>
        {produits.data.map(product => (
          <h1 key={product._id}>{product.ref}</h1>
        ))}
        <pre>{JSON.stringify(produits, null, 2)}</pre>
      </div>
    </Helmet>
  );
}

export default Contact;
